import React from "react";
import { FiCamera, FiCalendar, FiLoader } from "react-icons/fi";
import { useExifData } from "../utils/exifUtils";

const EnhancedCameraMetadata = ({ photo, enableRealTimeExif = false }) => {
  // Use real-time EXIF extraction if enabled and no static metadata exists
  const shouldUseRealTime = enableRealTimeExif && !photo.hasMetadata;
  const { metadata: dynamicMetadata, loading } = useExifData(
    shouldUseRealTime ? photo.src : null
  );

  // Determine which metadata to use
  const metadata = photo.hasMetadata ? photo : dynamicMetadata;
  
  // Don't render anything if there's no metadata and we're not loading
  if (!metadata && !loading) {
    return null;
  }

  // Show loading state
  if (loading) {
    return (
      <div className="camera-metadata">
        <div className="metadata-section">
          <FiLoader className="metadata-icon rotating" />
          <div className="metadata-content">
            <p>Loading camera metadata...</p>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="camera-metadata">
      {/* Camera and Lens info */}
      {(metadata.camera || metadata.lens) && (
        <div className="metadata-section">
          <FiCamera className="metadata-icon" />
          <div className="metadata-content">
            {metadata.camera && <p><strong>Camera:</strong> {metadata.camera}</p>}
            {metadata.lens && <p><strong>Lens:</strong> {metadata.lens}</p>}
          </div>
        </div>
      )}
      
      {/* Camera Settings */}
      {metadata.settings && Object.values(metadata.settings).some(v => v !== null) && (
        <div className="metadata-section">
          <div className="camera-settings">
            {metadata.settings.aperture && (
              <div className="setting-item">
                <span className="setting-label">Aperture:</span>
                <span className="setting-value">{metadata.settings.aperture}</span>
              </div>
            )}
            {metadata.settings.shutter && (
              <div className="setting-item">
                <span className="setting-label">Shutter:</span>
                <span className="setting-value">{metadata.settings.shutter}</span>
              </div>
            )}
            {metadata.settings.iso && (
              <div className="setting-item">
                <span className="setting-label">ISO:</span>
                <span className="setting-value">{metadata.settings.iso}</span>
              </div>
            )}
            {metadata.settings.focalLength && (
              <div className="setting-item">
                <span className="setting-label">Focal Length:</span>
                <span className="setting-value">{metadata.settings.focalLength}</span>
              </div>
            )}
          </div>
        </div>
      )}
      
      {/* Date */}
      {metadata.date && (
        <div className="metadata-section">
          <FiCalendar className="metadata-icon" />
          <div className="metadata-content">
            <p><strong>Date:</strong> {new Date(metadata.date).toLocaleDateString('en-US', { 
              year: 'numeric', 
              month: 'long', 
              day: 'numeric' 
            })}</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default EnhancedCameraMetadata;
